walk = tuple((j, i) for j in range(-1, 2) for i in range(-1, 2) if j or i)

from collections import defaultdict as d


def to_mountain(mat: list[list[int]]):
    # let us use method of descending
    elements = d(list[tuple[int, int]])

    max_j, max_i = len(mat), len(mat[0])
    for j in range(max_j):
        for i in range(max_i):
            elements[mat[j][i]].append((j, i))

    sorted_element_vals = sorted(elements.keys(), reverse=True)

    emitters = []

    initial_level = sorted_element_vals[0]
    current_level = initial_level
    print(f'now descending...')
    max_descent = max(max_j, max_i) - 1
    while current_level + max_descent >= initial_level:
        # if some potential emitters are at this level they should be added to 'emitters':
        emitters += elements[current_level]
        # the level descends:
        current_level -= 1
        print(f'   current level is: {current_level}')
        # new empty front of emitters initialized:
        new_emitters_front = []
        # emitters emit:
        for j, i in emitters:
            for dj, di in walk:
                if 0 <= (j_ := j + dj) < max_j and 0 <= (i_ := i + di) < max_i:
                    # if this one is not visited for now:
                    if (mat[j_][i_]) < current_level:
                        mat[j_][i_] = current_level
                        # adding new emitter to the new front:
                        new_emitters_front.append((j_, i_))

        # now new front becomes emitters and gets zeroes at the next step:
        print(f'   new front built: {new_emitters_front}')
        emitters = new_emitters_front

        # print(f'[{current_level}]th Mountained map: ')
        print_array(mat)

    return mat


def print_array(array: list[list[int]]) -> None:
    for string in array:
        print(f'   {string}')


